  ];

  const AvailableMeals = () => {

        const totalMeals = DUMMY_MEALS.map(meals => <MealItem id={meals.id}
          key={meals.id}
          id={mea}
          name={meals.name}
          description={meals.description}
          price={meals.price}/>)

        return (
            <Cards>
            <section className={classes.meals}>
           <ul> {totalMeals} </ul>
           </section>
           </Cards>
        )

  }

